import React from 'react';
import Col from 'react-bootstrap/Col';
import FilterForm from './FilterForm';

const Header = (props) => {
    return (
        <header>
            <Col>
                <h1>User Roles Management</h1>
            </Col>
            <FilterForm searchQuery={props.searchQuery} />
        </header>
    )
}

export default Header;
